import React from 'react';
import classes from './ErrorLog.module.css';

const errorLog = () => {
  return (
    <div className={classes.ErrorLog}>
      <textarea>"SUCCESS: Node 1 created
        SUCCESS: Node 2 created
        ERROR: Nodes cannot be linked"
      </textarea>
    </div>
  );
}

export default errorLog;
